import React from "react";
import "./index.css";
import Board from "./components/Board";

import Home from "./components/Home";

function App() {
  return (
    <div>
      <Switch>
        <Redirect exact from="/" to="/home" />
        <Board />
      </Switch>
    </div>
  );
}

export default App;
